import styled from "styled-components";

const ChannelWrapperStyled = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin-top: 1em;
  margin-left: 14.5em;
  margin-right: 14.5em;
`;

export default ChannelWrapperStyled;
